import { useNavigate } from "react-router-dom";
import axios from "axios";
function Listout() {
    const [user, setUser] = useState([])
    const [edituser, setEditUser] = useState([])
    const navigate = useNavigate()
    console.log(edituser)
    useEffect(() => {
        GetApi()

    }, []);

    const GetApi = () => {
        axios.get('http://localhost:1234/getUser')
            .then((res) => {
                console.log(res);
                setUser(res.data.data)
            })
    }

    const handleDelete = () => {
        axios.delete('http://localhost:1234/deleteUser')
            .then((res) => {
                console.log(res);

            })
    };
    const handleEditProcess = (index) => {
        if (index !== false) {
            const editedItem = user[index];
            setEditUser(editedItem)

        }
        updateUser()
    }

    const updateUser = () => {
        axios
            .put('http://localhost:1234/updateUser')
            .then((responce) => {
                navigate('/edituser')
                console.log(responce)
            })
            .catch((err) => {
                console.log("err")
            })
    }
    console.log(user);
    return (
        <div Form className="container-fluid m-3 bg-lite ">
            <div className="column">
                <div className='row mt-5 '>
                    <div className='column m-3'>
                        <label className="d-flex  align-items-center">Name:</label>
                        <input type='text' name="Name" value={formData.Name} maxLength={15} onChange={handleChange}></input>
